INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (1, 'Креатив в рекламе', 'Иван Дьяченко', '5 нестандартных способов придумать рекламу. Как создать атмосферу творчества и креатива в команде, чтобы получать впечатляющие результаты');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (1, 'Стратегия роста IT продуктов', 'Денис Мартынцев', 'Product led growth - продукт, который генерирует продажи без отдела продаж. Концепция роста продукта без отдела продаж и маркетинговых бюджетов.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (1, 'Маркетинг мобильных приложений', 'Егор Карпов', 'Как получить 20 000 установок приложения за 40 тысяч рублей. Научитесь разрабатывать и реализовывать маркетинговую стратегию продвижения приложений в РФ, СНГ, США и Азии.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (1, 'Икусство рекламной коммуникации', 'Александр Алексеев', 'Как бренду обрести свой голос и создавать нестандартную рекламу. Как создавать рекламные кампании на уровне международных брендов.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (1, 'Уникальное торговое предложение', 'Антон Шаяхов', 'Онлайн-практикум по разработке уникального торгового предложения. Выдели продукт среди конкурентов за 5 шагов.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (1, 'Маркетинг и тренды', 'Алексей Ежиков', 'Мастер-класс по маркетингу и трендам. Почему в глобальном мире гонка за трендами и отдельными инструментами - это fail, а прокачка базового понимания реальности - это must?');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (1, 'Клиентский сервис', 'Михаил Качалкин', 'Клиенто-центричность и клиентский сервис. Научитесь создавать клиентский сервис и условия, чтобы клиенты оставались с вами навсегда, а бывшие клиенты возвращались и становились фанатами вашего продукта.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (1, 'Бренд стратегии', 'Григорий Храбров', 'Если ваш продукт не уникален, создавайте бренд. Как построить платформу и стратегию бренда.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (1, 'E-mail маркетинг', 'Наталья Семагина', 'Онлайн-курс по стратегии email-рассылок. Сбор базы, сегментация, аналитика, дизайн и контент в email-рассылках. 4 типа триггерных рассылок, повышаем открываемость писем');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (1, 'Customer Journey Map', 'Виталий Мазуревич', 'Улучшаем клиентский опыт через построение карты путешествия клиента. Научитесь находить неожиданные способы улучшения продукта и сервиса благодаря построению CJM.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (2, 'Язык SQL и управление Базами Данных', 'Иван Иванов', 'Данные живут дольше программ. Научитесь ими управлять.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (2, 'Программирование на Python', 'Петр Петров', 'Научитесь программировать на наиболее популярном языке программирования с низким порогом вхождения');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (2, 'Data Science', 'Александр Александров', 'Научитесь извлекать знания и закономерности из данных');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (3, 'Типографика в Indesign', 'Holystick design buro', 'Макро и микротипографика, абзацы, шрифты, цвет. Верстка многостраничных изданий, журналов, книг, плакатов, социальных сетей.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (3, 'Дизайн в Figma', 'Александр Окунев', 'Как удобно организовать работу в Figma в большом, многостраничном проекте, знакомство с основами веб-дизайна, UX/UI дизайн интерфейсов.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (3, 'Интернет-магазина на Tilda', 'Сева Петров', 'Практикум по созданию интернет-магазина на Tilda в zero блоках. Подключение платежной системы и анимация и карточки товаров.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (3, 'After Effects', 'Дмитрий Грачев', 'На курсе вы научитесь создавать видео и анимацию с помощью программы Adobe After Effects.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (3, 'Профессия дизайнер', 'Денис Башев', 'Как составить бриф, подготовить структуру проекта, презентовать проект заказчику, назначить цену и не перегореть в рабочем процессе.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (3, 'Дизайн-мышление', 'Аглая Демиденко', 'Лекция о дизайн-мышлении, что такое критический дизайн, дизайн фикшен. Некоммерческий дизайн и примеры того, как дизайн может существовать вне рынка.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (3, 'Spark AR', 'Юрий Сахончик', 'Практикум по созданию AR-масок для продвинутых пользователей Spark AR и After Effects: 3D, анимация, текстуры, деформация.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (4, 'Копирайтинг', 'Константин Рудов', 'Без контент-плана бизнесу прожить можно, а без контент-стратегии нет, потому что деньги приносит стратегия, а не тексты. Научимся писать тексты, основанные на стратегии.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (4, 'Создание подкастов', 'Артур Белостоцкий', 'Как найти идею и формат подкаста, продвигать и монетизировать подкасты.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (4, 'Создание спецпроектов', 'Владислав Степнов', 'Бриф, идея, прогноз метрик, смета, и запуск спецпроектов. Книга рекордов Гинесса известна на весь мир и это спецпроект пивоварни Guiness. Один толковый спецпроект бывает лучше десятка миллионов потраченных на скучную рекламу.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (4, 'Создание вебинаров', 'Снежана Иванова', 'Как находить востребованные темы для вебинаров, как собрать четкую структуру контента из хаоса информации, сравнение вебинарных сервисов и настройка платежных форм.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (5, 'Методология онлайн-обучения', 'Евгения Ращупкина', 'Как создать онлайн-курс с высокими показателями по NPS, доходимости до конца обучения и увеличить лояльность учеников.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (5, 'PR и управление репутацией', 'Ксения Зайкова', 'PR без бюджета. Стратегические инсайты и практические инструменты, которые сделают PR-кампанию результативной. Концентрированные уроки от PR-специалиста с 11-летним опытом.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (5, 'Питчинг идеи стартапа', 'Денис Калышкин', 'Как стартапу рассказать о продукте, команде и деньгах. Рекомендации от практика, которые помогут подготовиться к питчингу идеи для инвестора.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (5, 'Питчинг идеи стартапа', 'Денис Калышкин', 'Как стартапу рассказать о продукте, команде и деньгах. Рекомендации от практика, которые помогут подготовиться к питчингу идеи для инвестора.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (5, 'Практикум по excel и google таблицам', 'Ренат Шагабутдинов', 'Научитесь анализировать данные, от экономики рекламных каналов до продаж по конкретному сегменту клиентов, товару или сотруднику.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (5, 'Тренд новой экономики', 'Борис Агатов', 'Как глобальные тренды влияют на поведение потребителей. Адаптация бизнеса в условиях меняющейся экономики.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (5, 'Мобильный нетворкинг', 'Леонид Бугаев', 'Научитесь заводить профессиональные знакомства и, что важнее, поддерживать связь с новыми контактами.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (5, 'Инвестиции', 'Никита Карташев', 'Как эффективно вкладывать деньги в акции, анализировать рынок и компании. Долгосрочный трейдинг простыми словами.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (6, 'Визуал в Instagram', 'Ольга Цаплина', 'Самый системный и творческий курс по визуалу в Instagram, который научит вас видеть кадры повсюду и транслировать через фото ценности, атмосферу и настроение блога.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (6, 'Чат-боты в мессенджерах', 'Анна Мельничук', 'Научимся создавать сценарии игровых, контентных, продающих ботов без навыков программирования, за 1 вечер.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (6, 'Сторителлинг', 'Снежана Иванова', 'Как находить сюжеты, вовлекать аудиторию и удерживать внимание.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (6, 'Монетизация в Instagram', 'Снежана Иванова', 'Разбор механик продаж и запусков для начинающих блогеров.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (7, 'Таргетинг в Instagram и ВКонтакте', 'Digital-агентство', 'Научимся анализировать и составлять портрет ЦА, разрабатывать медиастратегию, парсить аудиторию конкурентов и задавать эффективные настройки таргетинга.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (7, 'Автовебинары', 'Снежана Иванова', 'Как использовать автовебинары, чтобы не вызывать негатива у аудитории. Пример автовебинара, пошаговые инструкции по настройке и структуре.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (7, 'Контекстная реклама в Яндекс.Директ', 'Никита Кравченко', 'Сбор ключевых слов и семантического ядра, пишем кликабельные объявление, приводим релевантный трафик на сайт.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (7, 'Контекстная реклама в Google ADS', 'Никита Кравченко', 'Сбор ключевых слов и семантического ядра, пишем кликабельные объявление, приводим релевантный трафик на сайт.');
INSERT INTO `subject` (`faculty_id`, `subject_name`, `subject_author`, `subject_about`) VALUES (7, 'Реклама в Youtube', 'Алексей Дементьев', 'Пошаговый вебинар по настройке рекламы в Youtube, от сценария рекламного видео до настройки рекламы в пре-роллах через в Google ads.');
